import React from 'react';
import NavBar from '../Components/navbar';
import "./pagestyle.css";


function OW() {
  return (
  	<div style={{backgroundImage: "url(" + "../Images/owbackground.png" + ")"}}>
    	<NavBar />
    	Overwatch
    </div>
  );
}

export default OW;
